(function(){'use strict';window.SwaggerTranslator={_words:[],translate:function(sel){var $this=this;sel=sel||'[data-sw-translate]';Array.prototype.slice.call(document.querySelectorAll(sel)).forEach(function(elem){elem.innerHTML=$this._tryTranslate(elem.innerHTML);elem.value=$this._tryTranslate(elem.value);elem.setAttribute('title',$this._tryTranslate(elem.getAttribute('title')));});},_tryTranslate:function(word){word=word||'';return this._words[word.trim()]!==undefined?this._words[word.trim()]:word;},learn:function(wordsMap){this._words=wordsMap;}};})();